import React from 'react';
import ReactDom from 'react-dom'

import FunCom from'./todoList/funCom'
import ClassCom from'./todoList/classCom'
import List from'./todoList/list'

ReactDom.render(<div>
    <ClassCom/>
    <FunCom/>
    <List></List>
</div>, document.getElementById('root'))


